import { Box, Button, Stack, Grid } from '@mui/material';
import React from 'react';

const Mapa = ({ data }) => {
    const gridItems = Array.from({ length: 120 }, (_, index) => (
        <Grid item key={index} xs={1}>
            {<Button>{index+1}</Button>}
        </Grid>
    ));
    return (
        <React.Fragment>
            <Grid container spacing={1}>
                {gridItems}
            </Grid>
        </React.Fragment>
    );
}

export default Mapa;
